import React from "react";
import imageMyAcc from "../../../assets/hero.svg";

const MyAccount = () => {
  return (
    <div id="myAcc">
      <div className="container">
        <div className="myAcc">
          <img src={imageMyAcc} alt="" />
          <h1>hello</h1>
        </div>
      </div>
    </div>
  );
};

export default MyAccount;
